import React from 'react';
import ReactDom from 'react-dom';

export default function TutorialModal() {
  return ReactDom.createPortal(
    <React.Fragment>
      <div className="modal-overlay">
        <div
          className="modal-styles"
          onClick={(e) => {
            e.stopPropagation();
          }}
        ></div>
      </div>
    </React.Fragment>,
    document.getElementById('portal')
  );
}
